import React from "react";
import NextApp from "next/app";
import { ThemeProvider } from "styled-components";

export default class App extends NextApp {
  render() {
    const { Component, pageProps } = this.props;

    return (
      <ThemeProvider>
        <Component {...pageProps} />
      </ThemeProvider>
    );
  }
}
